import {BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import {useState} from "react";

function Nav(){
    const [open, setOpen] = useState(false);
    const handleClickAway = () =>{
        setOpen(false);
    };

    const handleClick = () =>{
        setOpen(!open);
    };

    return(
        <nav>
            <div className="Logo">
                <h1>Placeholder logo</h1>
            </div>
            <input id="Mobile-Nav-toggle" type="checkbox" onClick={handleClick} />
            <label className='Mobile-Nav-container' for="Mobile-Nav-toggle">
                <div className="Mobile-Nav"></div>
            </label>
            <ul className='Nav-Links'>
                <li className='Nav-Item'><Link onClick={handleClick} to='/'>Home</Link></li>
                <li className='Nav-Item'><Link to='/test'>Test</Link></li>
                <li className='Nav-Item'><Link to='/profile'>Profile</Link></li>
                <li className='Nav-Item'><Link to='/Login'>Login</Link></li>
            </ul>
        </nav>
    )
};

export default Nav
